description:
ABBYY FineReader, an Optical Character Recognition (OCR) application, converts printed and PDF documents and document images into editable computer files.

ABBYY FineReader features
Fast and accurate recognition

- ABBYY FineReader allows you to transform printed and PDF documents into an editable electronic document with QuickTasks that provide easy access to all major scanning, conversion, and recognition scenarios.
- ABBYY FineReader can recognize texts printed in virtually any font and is largely immune to printing defects.
- Seamless integration with Microsoft Office enables you to recognize documents directly from Microsoft Word, Microsoft Excel, or Microsoft Outlook.
